import React from 'react';
import './App.css';

const App: React.FC = () => {
  return (
    <div className="app">
      <nav className="navbar">
        <div className="navbar-brand">
          <div className="logo">
            <svg className="octopus" viewBox="0 0 100 100" width="50" height="50">
              <circle cx="50" cy="50" r="20" fill="#FF6B6B" />
              <circle cx="45" cy="45" r="5" fill="#4ECDC4" />
              <circle cx="55" cy="45" r="5" fill="#4ECDC4" />
              {/* Tentacles */}
              {[...Array(8)].map((_, i) => (
                <path
                  key={i}
                  d={`M ${50 + 20 * Math.cos((i * Math.PI) / 4)} ${
                    50 + 20 * Math.sin((i * Math.PI) / 4)
                  } Q ${50 + 30 * Math.cos((i * Math.PI) / 4)} ${
                    50 + 30 * Math.sin((i * Math.PI) / 4)
                  } ${50 + 40 * Math.cos((i * Math.PI) / 4)} ${
                    50 + 40 * Math.sin((i * Math.PI) / 4)
                  }`}
                  stroke="#FF6B6B"
                  strokeWidth="3"
                  fill="none"
                />
              ))}
            </svg>
            <span className="brand-name">CuriousOzzy</span>
          </div>
        </div>
        <div className="nav-links">
          <a href="#home">Home</a>
          <a href="#languages">Languages</a>
          <a href="#subjects">Subjects</a>
          <a href="#about">About Us</a>
          <button className="contact-btn">Contact Us</button>
        </div>
      </nav>

      <section className="hero">
        <div className="video-container">
          <div className="gradient-bg"></div>
          <div className="overlay"></div>
        </div>
        <div className="hero-content">
          <h1>Welcome to CuriousOzzy</h1>
          <p>Dive into a world of learning adventures!</p>
        </div>
      </section>
    </div>
  );
};

export default App;
